// src/components/Navbar.js

import React from 'react';
import { Link } from 'react-router-dom';  // Import Link

const Navbar = () => {
    return (
        <nav>
            <ul>
                <li><Link to="/add-transaction">Add Transaction</Link></li>  {/* Link to Add Transaction form */}
                <li><Link to="/transactions">View Transactions</Link></li>   {/* Link to View Transactions */}
            </ul>
        </nav>
    );
};

export default Navbar;
